import store from './store';
import React, {Component, Fragment} from 'react';
class Home extends Component{
    constructor(props){
        super(props);
        this.state={
            storage_: true,
            living: false
        }
        this.showContent = this.showContent.bind(this);
    }
    render(){
        return (
            <Fragment>
                <button onClick={this.showContent}></button>
                <div></div>
                <button></button>
                <div></div>
            </Fragment>
        )
    }
    showContent(){
        const storage = this.state.storage_;
        const living = this.state.living;
        this.setState({
            storage_: !storage,
            living:  !living
        })
    }
}
export default Home;
